import React from 'react';
import Intro from './components/Intro';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1 className="App-title">TV Series List</h1>
      </header>
      <Intro />
    </div>
  );
}

export default App;
